using MyMindV3.Interfaces;
using Newtonsoft.Json;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace MyMindV3.Classes
{
    internal class CareMapService : ICareMapService
    {
        public CareMapService()
        {
            // TODO: Complete member initialization
        }

        async Task<IEnumerable<Encryption>> ICareMapService.GetPatientAppointments(string hcp)
        {
            string url = string.Format(@"http://cass/CareMapApp/api/Appointment?hcp={0}", hcp);

            var client = new System.Net.Http.HttpClient();
            var response = await client.GetAsync(url);
            var encryptionJson = response.Content.ReadAsStringAsync().Result;
            //string encryptionJson = @"[{""Category"":""Appointment"",""Value"":"""",""Key"":"""",""IV"":""Vt+poVdIKGd/NPqhvPPC3w=="",""Hashmac"":""cDJwGiU/OnlktubG7BmW6UmH1fIfzQ/1k8Rgh/ytlxM=""}]";
            var encryptions = JsonConvert.DeserializeObject<IEnumerable<Encryption>>(encryptionJson);
            return encryptions;
        }

    }
}
